                                     identifiers[i] = (identifiers[i] === "\\[Lambda]") ? "Î»" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[CapitalLambda]") ? "Î›" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[Mu]") ? "Î¼" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[CapitalMu]") ? "Îœ" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[Nu]") ? "Î½" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[CapitalNu]") ? "Î" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[Xi]") ? "Î¾" : identifiers[i];
                                     identifiers[i] = (identifiers[i] === "\\[CapitalXi]") ? "Îž" : identifiers[i];
