angular.module('qqMathml', [])


    .directive("qqMathml", function () {
    return {
        restrict: "A",
        controller: ["$scope", "$element", "$attrs",
                     function ($scope, $element, $attrs) {
                         $scope.$watch($attrs.qqMathml, function (value) {
                             $element.empty();

                             // dont use MathJax to process nothing
                             if (typeof value === "undefined" || !value.length) {
                                 return;
                             }

                             if (value.indexOf("</math>") > -1){
                                 $element.append(value);
                                 MathJax.Hub.Queue(["Typeset", MathJax.Hub, $element[0]]);
                                 return;
                             }

                             // if the string contains LaTeX, then we need to pad
                             // <> inside the LaTeX with spaces or the brower will
                             // interpret them as tags
                             var latexStart, latexEnd, pre, post, latex, prettyMath;

                             // if there is latex
                             latexStart = value.indexOf("\\(");
                             if( latexStart > -1 ) {
                                 do{
                                     latexEnd = value.indexOf("\\)", latexStart)+2;
                                     if( latexEnd <= latexStart ){
                                         console.error("invalid latex");
                                         console.info( value );
                                         $element.append(value);
                                         return;
                                     }

                                     pre=value.substring(0,latexStart);
                                     // add spaces around < and > so the browser doesnt treat them as element tags
                                     latex=value.substring(latexStart, latexEnd).replace(/>/g, ' > ').replace(/</g, ' < ');
                                     post=value.substring(latexEnd, value.length);

                                     value = pre + latex + post;
                                     latexStart = value.indexOf("\\(", pre.concat(latex).length);
                                 }while(latexStart>-1);

                                 prettyMath = value.replace(/\s\\\(/g, '\\(\\;').replace(/\\\)\s/g, '\\;\\)');

                                 $element.append(prettyMath);
                                 MathJax.Hub.Queue(["Typeset", MathJax.Hub, $element[0]]);
                                 return;
                             }


                             $element.append(value);

                         });
                     }
                    ]
    };
});
