qqScribbles.directive('scribbles', ['$interval', function ($interval) {
    return {
        restrict: 'E',
        scope: {
            api: '='
        },
        templateUrl: "qq-directives/qq-scribbles.tpl.html",
        link: function (scope, element, attrs) {
            var nipple = false; // handle to the nipplejs widget
            var nippleBox = element[0].querySelector('.scPanner'); // div containing nipple

            var placeholder = element[0].querySelector('.editorPlaceholder');
            /*
                        scope.api.getStrokes = function () {
                            return scope.scx.getStrokes();
                        };
            */

            scope.scx = scribblesUI(placeholder);
            scope.scx.setPenColor("gray");
            scope.api = scope.scx;

            scope.zoom = 50;
            scope.zoomSet = function () {
                if (scope.zoom <= 50) {
                    console.info(scope.zoom, 'zooming OUT to', (scope.zoom / 50));
                    scope.scx.zoom(scope.zoom / 50);
                } else {
                    console.info(scope.zoom, 'zooming IN to', (scope.zoom - 50) / 10 + 1);
                    scope.scx.zoom((scope.zoom - 50) / 10 + 1);
                }
            };

            scope.$on('qq::resize', function () {

                // reset height and width of canvas element for responsive support
                var width = placeholder.clientWidth; //max width
                var height = placeholder.clientHeight; //max height
                scope.scx.resize(width, height);

                // setup or resize panning nipple
                var options = {
                    zone: nippleBox,
                    mode: 'static',
                    color: 'darkorange',
                    restOpacity: 1,
                    position: {
                        left: '22px',
                        top: '22px'
                    },
                    size: 30
                };

                // create nipple if it's container div is there with height and width
                nippleBox = element[0].querySelector('.scPanner');
                if (nippleBox === null || !nippleBox.clientHeight || !nippleBox.clientWidth) {
                    //console.error("no valid nipple container");
                    //console.info(nippleBox);
                    return;
                }

                if (!nipple) {
                    nipple = nipplejs.create(options);
                } else if (nipple) {
                    // destroy the nipple and rebuild it so it coords are correct
                    nipple.destroy();
                    nipple = nipplejs.create(options);
                }

                // set up event handlers for the nipple
                var nurple, nurpleStats;

                nipple.on('start', function (evt) {
                    //console.info('start');
                    if (angular.isDefined(nurple)) {
                        console.info('nurple is defined so resetting it.');
                        $interval.cancel(nurple);
                        nurple = undefined;
                        nurpleStats = undefined;
                    }

                    //console.info('starting nurple interval');
                    nurple = $interval(function () {
                        if (angular.isDefined(nurpleStats)) {
                            var xt, yt;
                            //console.info(nurpleStats.angle.radian, nurpleStats.distance);

                            var max_move = (nurpleStats.distance / 15) * (width / 50);

                            xt = max_move * Math.cos(nurpleStats.angle.radian);
                            yt = max_move * Math.sin(nurpleStats.angle.radian) * -1;

                            //console.info("(", xt, ",", yt, ")");
                            scope.scx.pan(xt, yt);
                        } else {
                            console.info('no stats');
                        }
                    }, 50);
                });
                nipple.on('move', function (evt, data) {
                    nurpleStats = data;
                });
                nipple.on('end', function (evt) {
                    //console.info('end');
                    if (angular.isDefined(nurple)) {
                        $interval.cancel(nurple);
                        nurple = undefined;
                        nurpleStats = undefined;
                    }
                });
            });
        }
    };
}]);

