var qqTouchboarder = angular.module("qqTouchboarder", []);


qqTouchboarder.directive('touchboarder', function () {
    return {
        restrict: "EA",
        scope: false,
        templateUrl: 'qq-directives/qq-touchboard.tpl.html',
        controller: ["$scope", function ($scope) {
            this.querium = true;
        }],
        link: function (scope, element, attr) {
            var canvasContainer = element[0].querySelector('#canvasContainer');
            var canvasText = element.find('canvas')[0];

            // get computed css styles from our fake element
            var canvasTextStyle = element[0].querySelector('#canvasStyle');
            var x = getComputedStyle(canvasTextStyle).getPropertyValue("left");
            var y = getComputedStyle(canvasTextStyle).getPropertyValue("top");
            var fontSize = getComputedStyle(canvasTextStyle).getPropertyValue("font-size");
            var background = getComputedStyle(canvasTextStyle).getPropertyValue("background-color");
            var color = getComputedStyle(canvasTextStyle).getPropertyValue("color");
            var fontFamily = getComputedStyle(canvasTextStyle).getPropertyValue("font-family");

            var testfield = new CanvasText( canvasText, {
                x: parseInt(x),
                y: parseInt(y),
                padding: 0,
                fontSize: parseInt(fontSize),
                width: canvasContainer.clientWidth,
                height: canvasContainer.clientHeight,
                defaultBackgroundColor: background,
                color: color,
                fontFamily: fontFamily
            } );

            scope.editingStep = '';
            scope.setEditingStep = function( newText ){
                scope.editingStep = testfield.value = newText;
                testfield.cursorPos = newText.length;
                testfield.refresh();
            };


            scope.keyPress = function( key, type, insert ){
                var text;

                switch (type) {
                    case "number":
                        text = ((typeof insert != 'undefined') ? insert : key);
                        break;
                    case "variable":
                        text = ((typeof insert != 'undefined') ? insert : key);
                        break;
                    case "operator":
                        text = ((typeof insert != 'undefined') ? insert : key);
                        break;
                    case "space":
                        text = " ";
                        break;
                    case "delete":
                        scope.editingStep = testfield.value;
                        scope.editingStepStartSelector = scope.editingStepEndSelector = testfield.cursorPos;
                        if( scope.editingStepStartSelector !== scope.editingStepEndSelector ){
                            scope.editingStep = scope.editingStep.substring( 0,scope.editingStepStartSelector ) + scope.editingStep.substring( scope.editingStepEndSelector );
                            scope.editingStepEndSelector = scope.editingStepStartSelector;
                        } else if( scope.editingStepStartSelector>0 ){ // single insertion point
                            scope.editingStepStartSelector--;
                            scope.editingStep = scope.editingStep.substring( 0,scope.editingStepStartSelector ) + scope.editingStep.substring( scope.editingStepEndSelector );
                            scope.editingStepEndSelector = scope.editingStepStartSelector;
                        }
                        scope.updateCurrentStep(scope.editingStep);
                        testfield.value = scope.editingStep;
                        testfield.cursorPos = scope.editingStepStartSelector;
                        testfield.refresh();
                        return;
                    case "clear":
                        scope.updateCurrentStep('');
                        scope.editingStepStartSelector = 0;
                        scope.editingStepEndSelector = 0;
                        testfield.value = scope.editingStep = '';
                        testfield.cursorPos = scope.editingStepStartSelector;
                        testfield.refresh();
                        return;
                    case "atomic":
                        scope.updateCurrentStep(key);
                        scope.editingStepStartSelector = 0;
                        scope.editingStepEndSelector = 0;
                        testfield.value = scope.editingStep = key;
                        testfield.cursorPos = scope.editingStepStartSelector;
                        testfield.refresh();
                        return;
                    case "go":
                        text='';
                        break;
                    default:
                        alert('an invalid type was passed to keyPress');
                        return;
                        //break;
                            }

                scope.editingStep = testfield.value;
                scope.editingStepStartSelector = scope.editingStepEndSelector = testfield.cursorPos;
                scope.editingStep = scope.editingStep.substring( 0,scope.editingStepStartSelector ) + text + scope.editingStep.substring( scope.editingStepEndSelector );
                scope.editingStepStartSelector = scope.editingStepStartSelector + text.length;
                scope.editingStepEndSelector = scope.editingStepStartSelector;
                scope.updateCurrentStep(scope.editingStep);
                testfield.value = scope.editingStep;
                testfield.cursorPos = scope.editingStepStartSelector;
                testfield.refresh();
                return;
            };

            scope.$on('qq::resize', function () {
                scope.resize();
            });

            scope.resize = function () {
                var ctn = element.find('canvas')[0];
                canvasText.width = ctn.clientWidth; //max width
                canvasText.height = ctn.clientHeight; //max height
                testfield.resize( canvasText.width, canvasText.height );
                testfield.refresh();
            }

            scope.resize();
        }
    };
})


